        <div className="dock-panel">
            <div className="search-bar-parent">
            <img className="search-bar-png2" src="/SearchBar.png" alt="-" />
            </div>
            <h4 className="oea-text">Omnibox Extension App</h4>
        </div>


        <style jsx>{`
        .dock-panel-parent {
            display: flex;
            align-items: center;
            justify-content: center;
        }

        .dock-panel {
                width: 1507px;
                height: 76px;
                font-family: Montserrat;
                font-size: 23px;
                background-color: #000000;
                background-image: linear-gradient(0deg, #000000 0%, #414141 74%);
                position: relative;
                display: flex;
                align-items: center;
                justify-content: center;
                bottom: 0px;
                background-color: black;
                color: white;
                border: black;
            } 

            .search-bar-parent {
                pointer-events: none;
            }

            .search-bar-png2 {
                width: 1507px;
                top:0px;
                padding-bottom: 158px;
            }

            .oea-text {
                font-family: Montserrat;
                font-size: 38px;
                bottom: -37px;
                position: absolute;
                left: 523px;
            }
            `}</style>







        </div>
    );
  }

  export default Dock;



